    false,nt"url": null,nt"notes": "This narrative report for Carolina Sandhills
    National Wildlife Refuge summarizes refuge activities from July through December
    1975. The report begins with a summary of weather and habitat conditions during
    the period. A refuge construction and maintenance section covers physical development
    and facilities improvements.  A habitat management section outlines farming, water
    levels, and timber activities. Wildlife including migratory birds, upland game birds,
    big game animals, fish, and furbearers is also covered. An interpretation and recreation
    section outlines recreational use, refuge visitation, and law enforcement. Items
    of interest are provided at the end of the report.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
